import { Button } from "antd";
import React, { Component } from "react";

class About extends Component {
  constructor(props) {
    super(props);
    this.state = {
      diameter: 100,
    };
  }
  shouldComponentUpdate() {}
  setDiameter = (d) => {
      this.setState({
        diameter:d
      });
  };
  render() {
    return (
      <>
        <Button>100像素圆</Button>
        <Button>200像素圆</Button>
        <Button>300像素圆</Button>
      </>
    );
  }
}

export default About;
